import { Table, TableCaption, Thead, Tr, Th, Tbody, Td, Select, Box } from "@chakra-ui/react";
import React, { useEffect, useState } from "react";

export interface DataTableProps{

}

const DataTable: React.FC<DataTableProps> = ()=> {

    const [data,updateData] = useState([]);

    useEffect( ()=> {
        const getData = async () => {
            const resp = await fetch('http://127.0.0.1:3001/menu');
            const json = await resp.json();
            updateData(json?.menu)
        }
        getData();
    }, []);
    console.log(data);


    return ( 
        <Box>
        <Table size="sm" variant="striped" colorScheme="teal">
        <TableCaption textAlign="center">Current reservations</TableCaption>
        <Thead>
          <Tr>
            <Th>Index</Th>
            <Th>Name</Th>
            <Th >Price</Th>
            <Th>Item</Th>
          </Tr>
        </Thead>
        <Tbody>
        {
            data.map((object, i) => {
                return (
                    <Tr>
                        <Td>{i+1}</Td>
                        <Td>{object['name']}</Td>
                        <Td>{object['price']}</Td>
                        <Td>{object['item']}</Td>
                    </Tr>
                )
            })
        }
        </Tbody>
      </Table>
      <Select></Select>
      </Box>



    );
}
export default DataTable;
